            "longDescription": "<p style=\"text-align:justify;\"><strong><a href=\"https://www.superpet.pe/marcas/canbo\" style=\"color:#e10600\">Canbo</a> Super Premium Cuidado del tracto urinario</strong> para gatos adultos es un alimento exclusivo que ayuda a mantener un sistema urinario saludable, mediante la acción conjunta de acidificantes estables que regulan el pH de la orina, logrando así disminuir el riesgo de la formación de cálculos de estruvita y oxalato.</p>\n<p style=\"text-align:justify;\">Promueve una mejor absorción de nutrientes ayudando a mejorar el tránsito intestinal, controla la formación de bolas de pelo y ayuda a mantener una dentadura saludable. </p>\n<p style=\"text-align:justify;\">Con BIO CARE, una fórmula especializada con acidificantes estables como Bisulfato de sodio, Metionina y Taurina, que actúan eficientemente en la regulación del pH urinario para prevenir la formación de cálculos de estruvita y oxalato en el tracto urinario de gatos de todas las razas. </p>\n<p style=\"text-align:justify;\"><strong>Las características de este producto son:</strong></p>\n<ul>\n<li style=\"text-align:justify;\"><strong>Salud bucal:</strong> Con Hexametafosfato que reduce la formación de sarro en los dientes. </li>\n<li style=\"text-align:justify;\"><strong>Salud del sistema urinario:</strong> Minerales, antioxidantes, ácidos grasos y aminoácidos para evitar trastornos urinarios. </li>\n<li style=\"text-align:justify;\"><strong>Máxima absorción de nutrientes:</strong> Prebióticos MOS y minerales aminoquelatados que optimizan el procesos digestivo. </li>\n<li style=\"text-align:justify;\"><strong>Salud intestinal:</strong> Fibra natural de Lignocelulosa para evitar la formación de bolas de pelo. </li>\n<li style=\"text-align:justify;\"><strong>Control de cálculos urinarios:</strong> Con acidificantes estables que regulan el pH de la orina y previenen cálculos renales. </li>\n</ul><p>Consulta este y otros productos similares en <a href=\"https://www.superpet.pe/gato/alimentos/alimento-medicado\" style=\"color:#e10600\"><b>Alimento medicado para Gato</b></a></p>",
            "shortDescription": "Diseñado exclusivamente para optimizar la salud y nutrición de gatos adultos de todas las razas.",
