            "longDescription": "<p>Alimento premium<strong> Canbo con Cordero ADULTO - Razas Pequeñas</strong> contiene 28% de proteína y 17% de grasas. Son croquetas específicamente diseñadas para animales de razas pequeñas. Promoviendo en todo momento una adecuada aprehensión y deglución del alimento. A su vez contiene la concentración energética adecuada para estas razas.</p>\n<p></p>\n<p><b>Características y beneficios:</b></p>\n<p></p>\n<ul><li><strong>Vitaminas y minerales orgánicos</strong>: Favorecen el correcto funcionamiento del sistema inmune, previniendo la aparición de enfermedades. Permiten una piel sana y el desarrollo de un pelaje resistente, suave y brillante.</li>\n<li><strong>Dientes brillantes</strong>: La textura de las croquetas ayuda a promover el efecto mecánico de limpieza y en combinación con los niveles adecuados de calcio, colaboran en la reducción de la formación de placa dentaria.</li>\n<li><strong>Antioxidantes naturales</strong>: La vitamina E (α-tocoferol), vitamina C y Selenio ayudan a bloquear la acción de radicales libres protegiendo a las células del envejecimiento</li>\n<li><strong>Omega 3 y 6</strong>: Ayudan a disminuir los niveles altos de colesterol y triglicéridos, previenen la formación de coágulos en las arterias evitando enfermedades cardiovasculares.</li>\n<li><strong>Fibra prebiótica y yucca schdigera</strong>: Esencial para animales con altos niveles de actividad física.</li>\n<li><strong>Proteínas de alta calidad</strong>: Propician una alta digestibilidad y reducción del olor en las deposiciones.</li>\n</ul><p></p>\n<p><strong>Las ventajas de este producto son:</strong></p>\n<p></p>\n<ul><li>100% completo y balanceado, elaborado con ingredientes de alta calida</li>\n</ul>",
            "shortDescription": "Alimento seco para perros de razas pequeñas sabor cordero, croquetas premium con 28% de proteína y 17% de grasas. Diseñadas para promover una aprehensión y deglución óptimas, con concentración energética adecuada. Vitaminas, minerales orgánicos, antioxidantes, omega 3 y 6, fibra prebiótica y Yucca Schidigera para razas activas. 100% completo y balanceado, ¡nutre a tus engreídos con lo mejor de Canbo!",
