            "maxOrderQuantity": 51,
            "variationAttributes": null,
            "longDescription": "<p style=\"text-align:justify;\">Para el tratamiento y prevención de infestaciones con pulgas y garrapatas en perros. Este medicamento de acción sistémica actúa en forma inmediata y persistente durante 12 semanas para matar garrapatas (Ixodes ricinus y Rhipicephalus sanguineus adultas y juveniles) y pulgas (Ctenocephalides felis y Ctenocephalides canis).</p>\n<p style=\"text-align:justify;\"><strong>Características y beneficios:</strong></p>\n<ul>\n<li>No aplicar en caso de hipersensibilidad al principio activo o a alguno de sus excipientes.</li>\n<li>No se deben romper o dividir los comprimidos masticables.</li>\n<li>Administre en el momento de la alimentación o cerca del horario de la misma.</li>\n<li>Bravecto es un comprimido masticable muy aceptado por los perros. Si el perro no ingiere el comprimido de forma voluntaria puede administrarse con el alimento o directamente en la boca. Se deberá observar el perro durante la administración para comprobar que haya ingerido el comprimido.</li>\n<li>Para un control óptimo de pulgas y garrapatas se debe administrar el producto a intervalos de 12 semanas. Bravecto puede administrarse durante todo el año.</li>\n<li>No utilizar en cachorros menores a 8 semanas de edad y/o perros que pesen menos de 2 kg.</li>\n<li>No administrar a intervalos menores a 8 semanas ya que no se evaluó la seguridad en tales circunstancias.</li>\n<li>Lávese las manos con abundante jabón y agua inmediatamente luego de utilizar el producto.</li>\n<li>Mantener el producto en el empaque original hasta su uso, con el fin de prevenir que los niños tengan acceso directo al producto.</li>\n<li>El producto puede ser utilizado en perras preñadas y en lactancia.</li>\n<li>Durante los estudios clínicos realizados, no se observaron interacciones entre Bravecto y ninguno de los medicamentos de uso habitual.</li>\n<li>Se demostró la seguridad del producto en perras preñadas y en lactancia tratadas con una sobredosis de hasta 3 veces la dosis máxima recomendada.</li>\n<li>Se demostró la seguridad del producto en cachorros de 8-9 semanas de edad y 2 – 3,6 kg de peso tratados con una sobredosis de hasta 5 veces la dosis máxima recomendada en 3 ocasiones a intervalos menores (8 semanas) que el indicado.</li>\n</ul>\n<p style=\"text-align:justify;\"><strong>Las ventajas de este producto son:</strong></p>\n<ul>\n<li>El producto demuestra una eficacia inmediata contra pulgas dentro de las 8 horas desde que la pulga se adhiere al huésped y 12 horas en el caso de las garrapatas.</li>\n<li>El producto controla de forma efectiva la población de pulgas en el ambiente en el que se encuentran los perros. Se puede utilizar como parte del tratamiento de la dermatitis alérgica por picadura de pulgas (DAPP).</li>\n</ul>\n<p><strong>Advertencias de uso:</strong></p>\n<ul>\n<li>No utilizar en caso de hipersensibilidad al principio activo o a cualquiera de los excipientes.</li>\n<li>Mantener fuera del alcance de los niños.</li>\n<li>Lavar las manos cuidadosamente con agua y jabón inmediatamente después de utilizar el producto.</li>\n<li>Mantener a temperatura ambiente, entre 15 y 30° C. Almacenar en un lugar seco y fresco, protegido de la luz.</li>\n<li>Después de su uso puede presentar síntomas gastrointestinales leves y transitorios tales como diarrea/ vómito/ inapetencia/ babeo, relacionados con la vía de administración del producto.</li>\n</ul>",
