            "longDescription": "<p style=\"text-align:justify;\">Comida para perros <strong><a href=\"https://www.superpet.pe/marca?b=dogxtreme\" style=\"color:#e10600\">Dogxtreme</a> Adult Cordero y Arroz</strong>. El alimento para perros <a href=\"https://www.superpet.pe/marca?b=dogxtreme\" style=\"color:#e10600\">Dogxtreme</a> está elaborado para perros adultos de cualquier raza. En su formato con cordero y arroz, la receta cuenta con un 20% de cordero fresco, un alimento perfecto para una correcta digestión, ya que el cordero ayuda a mejorar el sistema digestivo, además de que proporciona una piel y un pelaje brillantes y sanos, lo que dará a tu perro un aspecto totalmente sano.</p>\n<p style=\"text-align:justify;\">La receta del pienso para perros <a href=\"https://www.superpet.pe/marca?b=dogxtreme\" style=\"color:#e10600\">Dogxtreme</a> incluye pulpa de remolacha, que mejora la absorción de los nutrientes y mejora la salud digestiva, además de que mejora las defensas de nuestra mascota de la manera más natural y sin añadir ni colorantes. Los antioxidantes incluidos en la receta, tocoferoles, también son naturales, por lo que te asegurarás de estar proporcionando a tu perro la mejor alimentación posible con un delicioso sabor.</p>\n<p style=\"text-align:justify;\"><strong>Características y beneficios:</strong></p>\n<ul>\n<li>Alimento diseñado para perros adultos a partir de un año.</li>\n<li>La receta incluye un <strong>20% de cordero</strong> fresco.</li>\n<li>No contiene Subproductos</li>\n<li>Contiene antioxidantes naturales</li>\n<li>Mejora la salud digestiva gracias a la pulpa de remolacha.</li>\n<li>Incluye L-Carnitina, que optimiza la metabolización de las grasas.</li>\n<li>La receta añade yuca schidigera, que mejora las defensas y la absorción de nutrientes.</li>\n<li><strong>Medida aproximada de la croqueta:</strong> Forma de triángulo de 14mm de alto y 6.5mm de grosor.</li>\n</ul>\n<p><strong>Las ventajas de este producto son:</strong></p>\n<ul>\n<li>Proporciona una piel y un pelaje brillantes y sanos.</li>\n</ul>\n<p><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/gUlYTdl-MW4\" title=\"YouTube video player\" frameborder=\"0\"></iframe></p><p>Consulta este y otros productos similares en <a href=\"https://www.superpet.pe/perro/alimentos/alimento-seco\" style=\"color:#e10600\"><b>Alimento Seco para Perro</b></a></p>",
