            "longDescription": "<p style=\"text-align:justify;\"><strong><a href=\"https://www.superpet.pe/marca?b=dogxtreme\" style=\"color:#e10600\">Dogxtreme</a> Adult Salmon &amp; Rice</strong> es todo lo que tu mascota necesita para mantener una alimentación saludable y completa. La composición con salmón proporciona un gran número de recursos que ayudarán a tu mascota a mantenerse con una vitalidad óptima y un óptimo nivel de salud en el pelo y la piel.</p>\r\n<p style=\"text-align:justify;\">Si se va a realizar un cambio de alimento es recomendable hacerlo de forma gradual durante 7 días. Suministre la ración diaria, preferiblemente, dividida en 2 ó 3 tomas al día, y siempre a las mismas horas. La cantidad de alimento puede variar en función de la actividad, raza del perro y condiciones medioambientales. El perro debe disponer siempre de agua limpia y fresca.</p>\r\n<p style=\"text-align:justify;\"><strong>Características y beneficios:</strong></p>\r\n<ul>\r\n<li>Contiene <strong>Salmón 20%</strong> (salmón fresco 10 %, salmón deshidratado 10 %)</li>\r\n<li>No contiene Sub productos</li>\r\n<li>Contiene antioxidantes naturales</li>\r\n<li>Ayuda a mantener saludable el pelo de su mascota</li>\r\n<li>Energia y vitalidad</li>\r\n</ul>\r\n<p style=\"text-align:justify;\"><strong>Las ventajas de este producto son:</strong></p>\r\n<ul>\r\n<li>Contiene nutrientes que ayuda al optimo crecimiento de su mascota</li>\r\n</ul>\r\n<p style=\"text-align:justify;\"><iframe width=\"560\" height=\"315\" src=\"https://www.youtube.com/embed/gUlYTdl-MW4\" title=\"YouTube video player\" frameborder=\"0\"></iframe></p>\r\n<p style=\"text-align:justify;\"></p><p>Consulta este y otros productos similares en <a href=\"https://www.superpet.pe/perro/alimentos/alimento-seco\" style=\"color:#e10600\"><b>Alimento Seco para Perro</b></a></p>",
