            "longDescription": "<h2>Cuna desenfundable con erizos para perros</h2>\r\n<p>La hora de dormir ser&aacute; el momento m&aacute;s esperado por tu mascota una vez que tenga esta hermosa&nbsp;<strong>cuna desenfundable para perros</strong> dise&ntilde;ada por Leeby. Tiene <strong>estampado con erizos y flores</strong>&nbsp;<strong>sobre fondo blanco</strong>, que atraer&aacute; todas las miradas.</p>\r\n<p>Su&nbsp;<strong>forro es desenfundable&nbsp;</strong>para que lo puedas lavar con m&aacute;s facilidad. En el centro tiene un <strong>coj&iacute;n acolchado</strong>, el cual ayuda a conservar mejor el calor corporal.&nbsp;El&nbsp;<strong>relleno es de viscole&aacute;stico</strong>, para ofrecer un&nbsp;<strong>mejor soporte al animal</strong>.</p>\r\n<p>Si tu amigo peludo es de los que <strong>duerme acurrucado</strong>, esta cama le resultar&aacute; ideal, ya que cuenta con&nbsp;<strong>bordes elevados y acolchados</strong>, que ofrecen una mayor sensaci&oacute;n de privacidad y calidez.&nbsp;<strong>Uno de los bordes es m&aacute;s bajo</strong> que el resto, para <strong>facilitar&nbsp;el acceso&nbsp;al interior</strong>,&nbsp;en especial si es un perro&nbsp;peque&ntilde;o, con patas cortas, o movilidad reducida por edad o enfermedad.</p>\r\n<p>Todos los materiales utilizados en la elaboraci&oacute;n de este accesorio&nbsp;son <strong>resistentes y de alta calidad</strong>, por lo que soportan los tirones del animal. De forma adicional, cuenta con una <strong>base antideslizante</strong>, para que tu compa&ntilde;ero de cuatro patas no est&eacute; moviendo la cuna por todas partes.</p>\r\n<p>Puedes colocar esta cama&nbsp;suave para perros en cualquier rinc&oacute;n de tu hogar, de preferencia en un espacio tranquilo para la mascota y lejos de la luz directa. Recuerda que es un producto para animales y no para ni&ntilde;os, y que debes retirar todo el embalaje antes de entreg&aacute;rselo a tu fiel compa&ntilde;ero. As&iacute; mismo, si se llegara a deteriorar, debes desecharlo de inmediato.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Caracter&iacute;sticas:</strong></p>\r\n<ul>\r\n<li>Cuna&nbsp;para perros.</li>\r\n<li>Incluye un coj&iacute;n reversible y desenfundable.</li>\r\n<li>Posee base antideslizante.</li>\r\n<li>Con bordes elevados.</li>\r\n<li>Forma rectangular.</li>\r\n<li>Elegante estampado de erizos y flores sobre fondo blanco.</li>\r\n<li>Ofrece soporte completo para la mascota.</li>\r\n<li>Mantiene al animal lejos del suelo.</li>\r\n<li>Con relleno viscoel&aacute;stico.</li>\r\n<li>F&aacute;cil de lavar a m&aacute;quina.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>USO Y ESPECIFICACIONES:</strong></p>\r\n<p>Cuna&nbsp;desenfundable y reversible&nbsp;para perros.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Material:</strong></p>\r\n<p><strong>Tejido:</strong> 70% Algod&oacute;n, 30% Poli&eacute;ster.<strong> Relleno:</strong> 60% Troquelado visco, 40% Fibra hueca siliconada.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Instrucciones de lavado:</strong></p>\r\n<ul>\r\n<li>Lavar a m&aacute;quina a 30&deg;, con ciclo normal.</li>\r\n<li>No utilizar lej&iacute;a.</li>\r\n<li>No utilizar secadora.</li>\r\n<li>No usar plancha.</li>\r\n<li>No lavar&nbsp;en seco.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>Medidas:</strong></p>\r\n<table>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><strong>Talla</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Tama&ntilde;o</strong></p>\r\n</td>\r\n<td>\r\n<p><strong>Tipo de raza</strong></p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>S</p>\r\n</td>\r\n<td>\r\n<p>20 x 63 x 51 cm</p>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>M</p>\r\n</td>\r\n<td>\r\n<p>20 x 74 x 61 cm</p>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>\r\n<p>L</p>\r\n</td>\r\n<td>\r\n<p>20 x 86 x 66 cm</p>\r\n</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>",
            "shortDescription": "Leeby Good cuna  para perros con estampado de erizos, tiene base antideslizante y bordes elevados, incluye un cojín desenfundable reversible. La funda se puede lavar a máquina. Cuenta con relleno interno es de viscoelástico.",
