            "longDescription": "<h2>Cama c&oacute;moda acolchada para perros</h2>\r\n<p>Si deseas brindarle a tu mascota unas siestas c&oacute;modas y reparadoras pero, al mismo tiempo, deseas mantener la elegancia en casa en todo momento, debes ubicar en cualquier rinc&oacute;n de tu hogar el <strong>coj&iacute;n para perros Cushion Velvet Sand de Leeby.</strong></p>\r\n<p>Se trata de una <strong>cama esponjosa rectangular con relleno suave y acolchado</strong> que <strong>se adapta perfectamente al cuerpo de tu perro</strong>, independientemente de que duerma estirado o acurrucado, para brindarle un <strong>descanso con mayor comodidad</strong>. Adem&aacute;s, posee una <strong>base antideslizante</strong> para que evite moverla al dormir y permanezca fija.</p>\r\n<p>Posee un <strong>elegante color beige que lucir&aacute; estupendamente en cualquier lugar de casa</strong> y viene en <strong>varios tama&ntilde;os </strong>para que escojas la adecuada para tu mascota. Leeby ha creado esta cama c&oacute;moda para perros con materiales de alta calidad para brindar mayor durabilidad. Asimismo, es <strong>f&aacute;cil de lavar a m&aacute;quina para preservar su forma original</strong> y se mantenga siempre limpia.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Caracter&iacute;sticas:</strong></p>\r\n<ul>\r\n<li>Coj&iacute;n acogedor para perros.</li>\r\n<li>Relleno acolchado y suave para mayor comodidad.</li>\r\n<li>Dise&ntilde;o rectangular que se adapta al cuerpo de tu mascota.</li>\r\n<li>Base antideslizante.</li>\r\n<li>Color beige.</li>\r\n<li>Luce fenomenal en cualquier lugar de casa.</li>\r\n<li>F&aacute;cil de lavar a m&aacute;quina.</li>\r\n<li>Elaborada con materiales de alta calidad.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<p><strong>USO Y ESPECIFICACIONES:</strong></p>\r\n<p>Coj&iacute;n para perros, adecuado para ofrecer a tu mascota un accesorio c&oacute;modo donde podr&aacute; descansar.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Material:</strong></p>\r\n<p>Tejido: 100% poli&eacute;ster. Relleno: 100% poli&eacute;ster reciclado.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Instrucciones de lavado:</strong></p>\r\n<ul>\r\n<li>Se puede lavar a m&aacute;quina en fr&iacute;o.</li>\r\n<li>No utilizar lej&iacute;a.</li>\r\n<li>No se puede planchar.</li>\r\n<li>Puede limpiarse en seco.</li>\r\n</ul>\r\n<p><strong></strong></p>\r\n<p><strong>Gu&iacute;a de tallas:</strong></p>\r\n<table border=\"\"1\"\" cellpadding=\"\"1\"\" cellspacing=\"\"1\"\" style=\"\"width: 500px;\"\">\r\n<tbody>\r\n<tr>\r\n<td>Talla</td>\r\n<td>Tama&ntilde;o</td>\r\n<td>Tipo de raza</td>\r\n</tr>\r\n<tr>\r\n<td>S</td>\r\n<td>10 x 40 x 63 cm</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>M</td>\r\n<td>10 x 63 x 85 cm</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>L</td>\r\n<td>10 x 75 x 100 cm</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td>XL</td>\r\n<td>10 x 90 x 120 cm</td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>",
