            "selectedQuantity": 0,
            "minOrderQuantity": 1,
            "maxOrderQuantity": 7,
            "variationAttributes": null,
            "longDescription": "<p>Zoetis Revolution 6% para gatos de 2.6kg a 7.5kg es un parasiticida de amplio espectro, que permite el control y tratamiento de lombrices intestinales, Dirofilarias, Ácaros de la sarna, pulgas adultas, larvas y huevos en perros. También es efectivo en el control de las infestaciones producidas por garrapatas en perros. Contiene el ingrediente activo selamectin. </p>\r\n<p>Se absorbe rápidamente luego de la aplicación local, se distribuye por vía sistémica controlando los endoparásitos y luego se localiza en las glándulas sebáceas por donde llega a la piel para eliminar los ectoparásitos. Puede ser administrado inmediatamente después del baño, una vez seco el animal.</p>\r\n<p><strong>Características y beneficios:</strong></p>\r\n<ul>\r\n<li>1 tubo o unidad con 0,75ml (45mg de Selamectina). </li>\r\n<li>Elimina las pulgas de tu mascota de forma rápida con una acción duradera.</li>\r\n<li>Frena la contaminación del entorno.</li>\r\n<li>Trata lugares ya infectados por pulgas.</li>\r\n<li>Puede utilizarse como parte del tratamiento estratégico de la dermatitis alérgica por pulgas.</li>\r\n<li>Dosificación: La dosis es de 6 mg de selamectina por kg de peso, equivalente a 0,05 ml por kg de peso. Revolution se aplica, descargando el contenido del tubo en el cuello o entre los hombros y colocar cada 30 días para el control de garrapatas, pulgas y filarias.</li>\r\n<li>Contradicciones: Dado que los trabajos de desarrollo y registro fueron realizados en animales mayores de 6 semanas, no se recomienda su uso antes de alcanzar esa edad.</li>\r\n<li>Efectos colaterales: Puede presentarse una alopecia transitoria en el punto de aplicación, la cual desaparece sin tratamiento alguno.</li>\r\n</ul>\r\n<p><strong>Las ventajas de este producto son:</strong></p>\r\n<ul>\r\n<li>Se absorbe rápidamente luego de la aplicación local, se distribuye por vía sistémica controlando los endoparásitos y luego se localiza en las glándulas sebáceas por donde llega a la piel para eliminar los ectoparásitos.</li>\r\n</ul>\r\n\r\n<p style=\"color:rgb(0,0,0);font-family:Verdana, Arial, Helvetica, sans-serif;font-size:11px;font-style:normal;font-weight:400;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;text-align:justify;\"><strong>Advertencias de uso:</strong></p>\r\n<ul>\r\n<li style=\"text-align:justify;\">Uso veterinario.</li>\r\n<li style=\"text-align:justify;\">No masajear la piel con Revolution.</li>\r\n<li style=\"text-align:justify;\">No aplicar a piel con heridas; Revolution contiene alcohol isopropílico y el conservante hidroxitolueno butilado (BHT).</li>\r\n<li style=\"text-align:justify;\">No está indicado para su uso en seres humanos.</li>\r\n<li style=\"text-align:justify;\">Manténgase fuera del alcance de los niños.  </li>\r\n<li style=\"text-align:justify;\">Al tener contacto en seres humanos, REVOLUTION puede irritar la piel y los ojos.</li>\r\n<li style=\"text-align:justify;\">Lávese las manos después de usarlo y elimine cualquier resto de producto en contacto con la piel inmediatamente con agua y jabón. </li>\r\n<li style=\"text-align:justify;\">Es inflamable: mantener alejado del calor, chispas, llamas u otras fuentes de ignición.</li>\r\n<li style=\"text-align:justify;\">No se debe usar en animales enfermos, debilitados o con bajo peso.</li>\r\n<li style=\"text-align:justify;\">En raras ocasiones tienen síntomas de vómitos, deposiciones sueltas o diarrea con o sin sangre, anorexia, letargo, salivación, taquipnea y temblores musculares. </li>\r\n</ul>\r\n<p></p>\r\n<p></p>\r\n<p></p>",
