            "longDescription": "<p style=\"text-align:justify;\"><strong>Mpets™ Dental Care Set - Beef Flavor Toothpaste Kit</strong> tiene todos los elementos que necesitas para ayudar al cuidado dental de tu mascota. Contiene varias piezas que harán más fácil la tarea de mantener unas encías y unos dientes saludables.</p><p style=\"text-align:justify;\">Este set le proporciona a tu mascota el más alto nivel de cuidado dental. El cepillo de dientes está diseñado para una limpieza fácil y rápida, que ayuda a mantener una salud oral óptima. Por lo que, cepillando sus dientes diariamente ayudarás a prevenir enfermedades de las encías, caries y minimizar el riesgo de perder piezas dentales. Sus cerdas suaves garantizan seguridad y comodidad para tu mascota.</p><p style=\"text-align:justify;\"><strong>MPETS™</strong> Es una empresa especializada en la distribución de productos funcionales, innovadores, exclusivos y asequibles para mascotas, con el fin de hacerlas felices al recibir juguetes y accesorios para compartir momentos memorables con sus propios dueños.</p><p style=\"text-align:justify;\"><strong>Las características de este producto son:</strong></p><ul><li>Cabezal de cepillo pequeño para los molares y cabezal de cepillo grande para los dientes frontales.</li><li>Cepillo de masaje de las encías para promover la circulación sanguínea y prevenir la retracción de las encías.</li><li>Cepillo de dientes para limpiar áreas sensibles.</li><li>Pasta de dientes para blanquear los dientes.</li></ul><p style=\"text-align:justify;\"><strong>El juego de cuidado dental incluye:</strong></p><ul style=\"list-style-type:disc;\"><li>Cepillo de dientes</li><li>Cepillo de masaje</li><li>Cepillo de doble punta</li><li>Pasta de dientes con sabor a carne</li></ul><p style=\"text-align:justify;\"><strong>Los beneficios de usar este set de cuidado dental son:</strong></p><ul style=\"list-style-type:disc;\"><li>Proporcione a su mascota el más alto nivel de cuidado dental para mascotas. El cepillo de dientes para mascotas está diseñado para una limpieza fácil y rápida, para ayudar a mantener una salud bucal óptima para su mascota. Los cepillos de dientes de mango largo están diseñados con un cepillo pequeño y uno grande y permiten una limpieza de fácil alcance en las áreas profundas de la boca.</li><li>MASCOTA SALUDABLE: Cepillar los dientes de su mascota a diario puede prevenir la enfermedad de las encías y la caries dental, y minimizar el riesgo de pérdida de dientes para su mascota.</li><li>Fabricado con materiales de la más alta calidad, este juego de cepillos de dientes está diseñado con cepillos suaves para garantizar un cepillado suave para la salud, seguridad y comodidad de su mascota.</li></ul><p><strong>Contenido:</strong></p><ul><li>Incluye pasta dental 1 tubo de 100 gr.</li></ul>",
            "shortDescription": "Set de cuidado dental de 4 piezas para mantener encías y dentaduras saludables.Incluye pasta dental sabor a carne para perros.",
