            "selectedQuantity": 0,
            "minOrderQuantity": 1,
            "maxOrderQuantity": 3,
            "variationAttributes": null,
            "longDescription": "<p>Ofrece a tu mascota el mejor lugar para dormir con Snoozy de MPETS. Esta acogedora cama para gatos est&aacute; dise&ntilde;ada para brindarle a tu amigo peludo un refugio c&oacute;modo y port&aacute;til donde pueda descansar pl&aacute;cidamente.</p>\r\n\r\n<p>Fabricada con fieltro reciclado de alta calidad, Snoozy es una opci&oacute;n respetuosa con el medio ambiente que tambi&eacute;n garantiza la comodidad y durabilidad para tu mascota. Su suave textura proporciona un lugar acogedor para que tu gato se acomode y se relaje, creando as&iacute; el ambiente perfecto para la siesta.</p>\r\n\r\n<p>Esta cama es ideal para la mascota que disfruta de la siesta en privado. Su dise&ntilde;o discreto y compacto le brinda a tu gato un espacio &iacute;ntimo donde pueda descansar sin ser molestado. Adem&aacute;s, su portabilidad permite colocarla en diferentes &aacute;reas de tu hogar seg&uacute;n las preferencias de tu mascota.</p>\r\n\r\n<p>En resumen, Snoozy de MPETS es la opci&oacute;n perfecta para proporcionarle a tu gato un lugar c&oacute;modo y acogedor para dormir. Fabricada con materiales de alta calidad y dise&ntilde;ada pensando en el bienestar de tu mascota, esta cama garantiza que tu gato tenga un refugio tranquilo donde pueda recargar energ&iacute;as y disfrutar de sus momentos de descanso.</p>",
            "shortDescription": "Brinda el mejor lugar para dormir a tu mascota con Snoozy de Mpets. Esta acogedora cama para gatos está hecha de fieltro reciclado de alta calidad, proporcionando un refugio cómodo y portátil para tu amigo peludo. Ideal para la mascota que disfruta de la siesta en privado.",
