            "selectedQuantity": 0,
            "minOrderQuantity": 1,
            "maxOrderQuantity": 82,
            "variationAttributes": null,
            "longDescription": "<p><strong>Hill's® Prescription Diet™ Feline c/d™ Multicare</strong> <strong>Pollo</strong> resulta más fácil mantener sano el tracto urinario de los gatos y se reduce el riesgo de reaparición de los cálculos urinarios. Contiene un balance correcto de nutrientes vitales para ayudar a mejorar las condiciones de la mayoría de las vías urinarias inferiores sin la necesidad cirugía. </p>\n<p><strong>HILL'S PET NUTRITION®</strong> tiene un compromiso con el bienestar animal, cree que el cuidado de calidad para las mascotas incluye nutrición, cuidados veterinarios a la salud, ejercicio diario y mucho amor. Todas las mascotas de Hill's Pet Nutrition viven en ese ambiente. Solamente usan métodos compasivos, no invasivos para desarrollar tecnología nutricional para que los perros y gatos del mundo tengan vidas largas y sanas.</p>\n<p></p>\n<p><b>Características y beneficios:</b></p>\n<p></p>\n<p></p>\n<ul><li><strong>Comprobado clínicamente:</strong> Disuelve los cálculos de estruvita estériles a partir del día 14. </li>\n<li><strong>Ayuda a reducir:</strong> La recurrencia de los cálculos de estruvita y oxalato cálcico. </li>\n<li><strong>Adecuado para la alimentación a largo plazo</strong>: No es necesario cambiar de alimento. </li>\n<li><strong>Calidad nutricional:</strong> No contiene colorantes, saborizantes ni conservantes artificiales.</li>\n</ul><p></p>\n<p><strong> Las ventajas de este producto son:</strong> </p>\n<p></p>\n<ul><li>Alimento realmente completo y balanceado que proporciona toda la nutrición que los gatos necesitan</li>\n</ul></br><p>Consulta este y otros productos similares en <a href=\"https://www.superpet.pe/gato/alimentos/alimento-seco\" style=\"color:#e10600\"><b>Alimento Seco para Gato</b></a></p>",
            "shortDescription": "Hill's PD c/d Multicare es un alimento seco para gatos diseñado para el cuidado urinario multicuidado. Proporciona un balance correcto de nutrientes vitales para ayudar a mejorar la salud de las vías urinarias de los gatos.",
