            "selectedQuantity": 0,
            "minOrderQuantity": 1,
            "maxOrderQuantity": 43,
            "variationAttributes": null,
            "longDescription": "<p style=\"text-align:justify;\"><strong><a href=\"https://www.superpet.pe/marcas/barker\" style=\"color:#e10600\">Barker</a> Cat</strong> es alimentación natural, completa y balanceada formulada con NutraBalance especialmente para Gatos. Aporta el 100% de nutrientes que requieren los gatos. Es de alto valor proteico y energético con ingredientes frescos de grado de consumo humano. Además representa una fuente de hidratación natural. Es apto para todas las edades y tamaños desde el destete hasta gatos de edad avanzada.</p>\n<p style=\"text-align:justify;\"><strong>Las características y beneficios de este alimento son:</strong></p>\n<ul style=\"list-style-type:disc;text-align:justify;\">\n<li>Alimento fisiológicamente adecuado, 100% natural, completo y balanceado.  </li>\n<li>Contempla un perfil nutricional completo con 43 nutrientes esenciales.</li>\n<li>Con NutraBalance: Una sinergia de nutrientes naturales que potencia la salud renal, hepática, ocular y cardiaca.</li>\n<li>Brinda equilibrio hídrico para prevenir problemas renales.</li>\n<li>Favorece la salud de la piel y sistema inmune.</li>\n<li>Con Fibra natural para la prevención y control de Bolas de Pelos.</li>\n<li>Brinda equilibrio hídrico para prevenir problemas renales.</li>\n</ul>\n<p style=\"text-align:justify;\"><strong>Ingredientes principales: </strong></p>\n<ul style=\"list-style-type:disc;\">\n<li style=\"text-align:justify;\">Carne de Pollo: Proteína de alta digestibilidad y baja en grasas saturadas.</li>\n<li style=\"text-align:justify;\">Aceite de Trucha: Alto aporte de EPA y DHA, apoya la salud cognitiva, cardiovascular y de la piel y pelaje.</li>\n<li style=\"text-align:justify;\">Extractos de Toronjil, Silimarina y Romero: Antiestrés, antioxidante y protector hepático natural.</li>\n<li style=\"text-align:justify;\">Hígado de Pollo: Adecuado aporte de hierro y alto nivel de Vitamina A, ácido fólico y riboflavina.</li>\n<li style=\"text-align:justify;\">Brócoli: Alto aporte de fibras prebióticas funcionales para una mejor salud digestiva.</li>\n</ul><p>Consulta este y otros productos similares en <a href=\"https://www.superpet.pe/gato/alimentos/alimento-barf\" style=\"color:#e10600\"><b>Alimento BARF para Gato</b></a></p>",
