            "longDescription": "<p style=\"text-align:justify;\"><strong>Corsa Pet Carriers</strong> es la solución ideal para las necesidades de transporte de su mascota. Está equipado con un bloqueo de seguridad, una puerta para mascotas y una asa para agarre del transportador.</p>\n<p style=\"text-align:justify;\">MPETS™ Es una empresa especializada en la distribución de productos funcionales, innovadores, exclusivos y asequibles para mascotas, con el fin de hacerlas felices al recibir juguetes y accesorios para compartir momentos memorables con sus propios dueños.</p>\n<p style=\"text-align:justify;\"><strong>Las características de este producto son:</strong></p>\n<ul>\n<li>Transportador para perros y gatos.</li>\n<li>Material de plástico.</li>\n<li>Tapa superior</li>\n<li>Durable, resistente y seguro.</li>\n<li>Ideal para transportar a su mascota en automóvil, autobús, tren o incluso en avión.</li>\n<li>Construido con orificios de ventilación óptimos. </li>\n</ul>\n<p style=\"text-align:justify;\"><strong>Medidas: </strong></p>\n<ul>\n<li><strong>Talla S</strong></li>\n</ul>\n<p style=\"text-align:justify;\">47,5 x 32 x 26 cm</p>\n<p style=\"text-align:justify;\">Para perros con peso menor a 4,5 kg</p>\n<ul>\n<li><strong>Talla M</strong></li>\n</ul>\n<p style=\"text-align:justify;\">57 x 38 x 33 cm</p>\n<p style=\"text-align:justify;\">Para perros con peso menor a 11 kg</p>",
