            "selectedQuantity": 0,
            "minOrderQuantity": 1,
            "maxOrderQuantity": 7,
            "variationAttributes": null,
            "longDescription": "<h2>Cama donut desenfundable para gatitos</h2>\n<p>Si tu felino amigo est&aacute; en crecimiento y necesitas ense&ntilde;arle donde puede descansar para que se acostumbre desde temprana edad, debes colocarle en casa la <strong>cama para gatitos de Leeby.</strong> Posee un <strong>acolchado fenomenal que garantiza un descanso &oacute;ptimo</strong> para tu mascota.</p>\n<p>Este fant&aacute;stico accesorio posee un <strong>dise&ntilde;o en forma de donut junto con unos bordes elevados</strong> y un <strong>acabado esponjoso que garantizan suavidad, comodidad y una sensaci&oacute;n acogedora &uacute;nica</strong> para que tu gatito pueda dormir tranquilamente durante horas. &iexcl;Le encantar&aacute;!</p>\n<p>El coj&iacute;n del centro <strong>es reversible</strong> y cuenta con un <strong>llamativo estampado de ovejitas</strong>, ideal para que luzca fenomenal en cualquier lugar de casa donde lo coloques. Adem&aacute;s, <strong>es desenfundable</strong>, perfecto para lavarlo con mayor facilidad, mantenerlo siempre limpio y en su forma original.</p>\n<p>Leeby ha creado esta cama para gatitos con materiales de alta calidad para garantizar una mayor durabilidad y funcionabilidad. Cuenta con un <strong>elegante color blanco que lucir&aacute; estupendamente</strong> en cualquier rinc&oacute;n de casa para que tu peque&ntilde;o felino descanse c&oacute;modamente.</p>\n<p>&nbsp;</p>\n<p><strong>Caracter&iacute;sticas:</strong></p>\n<ul>\n<li>Cama para gatitos.</li>\n<li>Dise&ntilde;o redondo en forma de donut suave y c&oacute;modo para descansos &oacute;ptimos.</li>\n<li>Bordes elevados para una sensaci&oacute;n acogedora.</li>\n<li>Acabado esponjoso.</li>\n<li>El coj&iacute;n del centro es reversible.</li>\n<li>Es desenfundable para un lavado r&aacute;pido.</li>\n<li>F&aacute;cil de lavar.</li>\n<li>Color blanco con estampado de ovejitas.</li>\n<li>Luce fenomenal en cualquier lugar de casa.</li>\n<li>Elaborada con materiales de alta calidad.</li>\n</ul>\n<p>&nbsp;</p>\n<p><strong>USO Y ESPECIFICACIONES:</strong></p>\n<p>Cama para gatitos, adecuado para ofrecer a tu mascota un accesorio donde podr&aacute; descansar c&oacute;modamente.</p>\n<p>&nbsp;</p>\n<p><strong>Material:</strong></p>\n<p>Tejido: 100% poli&eacute;ster. Relleno: 100% poli&eacute;ster.</p>\n<p>&nbsp;</p>\n<p><strong>Instrucciones de lavado:</strong></p>\n<ul>\n<li>Se puede lavar a m&aacute;quina por separado y en programa delicado.</li>\n<li>Agitar mientras est&aacute; h&uacute;medo para amoldar el relleno.</li>\n<li>No meter en secadora.</li>\n<li>No utilizar lej&iacute;a.</li>\n<li>No se puede planchar.</li>\n<li>No debe ser limpiado en seco.</li>\n</ul>\n<p><strong></strong></p>\n<p><strong>Gu&iacute;a de tallas:</strong></p>\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" style=\"width: 300px;\">\n<tbody>\n<tr>\n<td>Alto</td>\n<td>Ancho</td>\n<td>Profundidad</td>\n</tr>\n<tr>\n<td>15 cm</td>\n<td>40 cm</td>\n<td>40 cm&nbsp;</td>\n</tr>\n</tbody>\n</table>",
            "shortDescription": "Cama en forma de donut con acabado suave y diseño cómodo. El cojín del centro es reversible y desenfundable con estampado de ovejitas, ideal para un fácil lavado.",
