            "longDescription": "<p>Los cachorros de razas peque&ntilde;as tienen elevados requerimientos nutricionales por unidad de peso comparados con los cachorros de razas medianas y grandes, lo que los lleva a requerir de mayores demandas energ&eacute;ticas por unidad de peso. Ello obedece a que los ratios de &aacute;rea corporal son muy superiores a los cachorros de razas grandes, por lo que hay mayores demandas energ&eacute;ticas por unidad de peso.</p>\n\n<p>A la vez las razas peque&ntilde;as tienen est&oacute;magos peque&ntilde;os que limitan el consumo de alimento. Por ello las f&oacute;rmulas de alimento balanceado para razas peque&ntilde;as tienen una densidad energ&eacute;tica y nutricional superior. Adicionalmente la selecci&oacute;n de ingredientes debe apuntar a tener una alta digestibilidad.</p>\n\n<p>Todos estos factores se correlacionan directamente con el tama&ntilde;o y forma de las croquetas que son dise&ntilde;adas para las bocas peque&ntilde;as, facilitando as&iacute; su masticaci&oacute;n y degluci&oacute;n.&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p><b>Caracter&iacute;sticas y beneficios:</b></p>\n\n<ul>\n\t<li style=\"text-align:justify;\">\n\t<p><strong>Vitaminas y Minerales:</strong> La inclusi&oacute;n de vitaminas y minerales en esta f&oacute;rmula no solo favorece el sistema inmunol&oacute;gico, sino que tambi&eacute;n previene la aparici&oacute;n de enfermedades. Cada componente contribuye a la salud global de tu mascota, proporcionando un respaldo esencial para su bienestar.</p>\n\t</li>\n\t<li style=\"text-align:justify;\">\n\t<p><strong>DHA / EPA (Omega 3 y 6):</strong> La presencia de DHA y EPA, conocidos como Omega 3 y 6, no solo apoya el desarrollo del sistema nervioso central, sino que tambi&eacute;n contribuye al desarrollo cognitivo y visual. Estos &aacute;cidos grasos esenciales facilitan el aprendizaje durante las etapas tempranas de adiestramiento, asegurando un crecimiento integral.</p>\n\t</li>\n\t<li style=\"text-align:justify;\">\n\t<p><strong>Prote&iacute;nas de Alta Calidad:</strong> Las prote&iacute;nas de alta calidad no solo promueven un crecimiento muscular armonioso, sino que tambi&eacute;n contribuyen al desarrollo general de tu mascota. Son esenciales para proporcionar la energ&iacute;a necesaria para mantener su vitalidad diaria.</p>\n\t</li>\n\t<li style=\"text-align:justify;\">\n\t<p><strong>Glucosamina:</strong> La glucosamina en esta f&oacute;rmula es clave para el funcionamiento adecuado de las articulaciones y el crecimiento de huesos sanos y fuertes. Proporciona los nutrientes esenciales para garantizar la movilidad y salud &oacute;sea a largo plazo.</p>\n\t</li>\n\t<li style=\"text-align:justify;\">\n\t<p><strong>Minerales Org&aacute;nicos y Vitaminas:</strong> Los minerales org&aacute;nicos y vitaminas incluidos permiten una piel sana y el desarrollo de un pelaje resistente, suave y brillante. Cada componente se selecciona cuidadosamente para mejorar la salud y apariencia externa de tu mascota.</p>\n\t</li>\n\t<li style=\"text-align:justify;\">\n\t<p><strong>Fibra Prebi&oacute;tica y Yucca Schidigera:</strong> La fibra prebi&oacute;tica y Yucca Schidigera no solo propician una alta digestibilidad, sino que tambi&eacute;n reducen notablemente el olor de las deposiciones. Este toque adicional mejora la comodidad y bienestar general de tu mascota.</p>\n\t</li>\n</ul>\n\n<p style=\"text-align:justify;\"><strong>Las ventajas de este producto son:</strong></p>\n\n<p style=\"text-align:justify;\">La f&oacute;rmula de alimento balanceado para razas peque&ntilde;as no solo ofrece una densidad energ&eacute;tica y nutricional superior, sino que tambi&eacute;n est&aacute; dise&ntilde;ada para adaptarse a las necesidades espec&iacute;ficas de razas peque&ntilde;as. Un enfoque integral para garantizar la salud y vitalidad de tu compa&ntilde;ero peque&ntilde;o.</p><p>Consulta este y otros productos similares en <a href=\"https://www.superpet.pe/perro/alimentos/alimento-seco\" style=\"color:#e10600\"><b>Alimento Seco para Perro</b></a></p>",
            "shortDescription": "Alimento seco para Cachorros (0 a 12 meses) de razas pequeñas. Las necesidades nutricionales de estos, son elevadas debido a su mayor demanda energética por unidad de peso y estómagos más pequeños. Las fórmulas para razas pequeñas ofrecen densidad energética y nutricional superior, con ingredientes de alta digestibilidad. Las croquetas diseñadas para bocas pequeñas facilitan la masticación y deglución. ¡Opta por el alimento ideal para el bienestar de tu cachorro pequeño!",
