            "variationAttributes": null,
            "longDescription": "<p style=\"text-align:justify;\">Ayude a su perro a tener una vida más sana y feliz con el alimento para perros <strong>Hill’s Science Diet Adult Small Bites</strong>. Proporciona una nutrición equilibrada para perros que prefieren una croqueta más pequeña. Promueve un sistema inmunológico eficiente, piel y pelo suaves, mantenimiento de masa muscular, fácil digestión, órganos vitales y corazón saludables.</p>\r\n<p style=\"text-align:justify;\">Este alimento premium seco para perros está hecho con cordero como ingrediente #1 para ayudar a desarrollar músculos fuertes y magros y para mantener un peso corporal ideal. Contiene una mezcla exclusiva de ácidos grasos omega-6 y otros nutrientes para mejorar la salud de la piel y pelaje para una diferencia visible en tan solo 30 días (vs. alimentos comerciales). También proporciona una mezcla antioxidante clínicamente comprobada para favorecer un sistema inmunológico sano. Y como todos los alimentos secos Hill’s Science Diet Adult Small Bites no contiene colores, sabores o conservadores artificiales.</p>\r\n<p style=\"text-align:justify;\"><strong>Características y beneficios:</strong></p>\r\n<ul style=\"list-style-type:disc;text-align:justify;\">\r\n<li>Ingredientes de alta calidad y fáciles de digerir.</li>\r\n<li>Omega 6 y vitamina E para una pelaje radiante.</li>\r\n<li>Proteína para construir músculos magros.</li>\r\n<li>Alimento para los que prefieren croquetas pequeñas.</li>\r\n<li>Provee un balance nutricional preciso.</li>\r\n<li>No se recomienda para cachorros, hembras gestantes y/o lactantes.</li>\r\n</ul>\r\n<p style=\"text-align:justify;\"><strong>Las ventajas de este producto son:</strong></p>\r\n<ul style=\"list-style-type:disc;\">\r\n<li style=\"text-align:justify;\">No contiene colorantes, saborizantes o preservantes artificiales.</li>\r\n</ul><p>Consulta este y otros productos similares en <a href=\"https://www.superpet.pe/perro/alimentos/alimento-seco\" style=\"color:#e10600\"><b>Alimento Seco para Perro</b></a></p>",
            "shortDescription": "Hill's Science Diet Adult Small Bites, cordero y arroz, es un alimento balanceado específicamente formulado para perros de 1 a 6 años de edad. Con un delicioso sabor a cordero y arroz, brinda una nutrición de calidad que satisface las necesidades específicas de tu mascota. Descubre la elección perfecta para perros adultos en cada bocado.",
