            "longDescription": "<p style=\"text-align:justify;\"><strong>BOWL DE PLÁSTICO 200 ml</strong> los tazones de plástico M-PETS están equipados con patas antideslizantes, fáciles de limpiar y aptas para lavavajillas. Este plato está hecho de plástico con la mejor calidad, es duro y resistente con el uso diario, contiene 200ml para usar tanto en alimento como en agua.</p>\n<p style=\"text-align:justify;\">MPETS™ Es una empresa especializada en la distribución de productos funcionales, innovadores, exclusivos y asequibles para mascotas, con el fin de hacerlas felices al recibir juguetes y accesorios para compartir momentos memorables con sus propios dueños.</p>\n<p style=\"text-align:justify;\"><strong>Las características y ventajas de este producto son:</strong></p>\n<ul>\n<li style=\"text-align:justify;\"><strong>Para todo tipo de alimentos:</strong> No solo sirve para la comida seca, también puedes darle comida húmeda como patés, carnes, agua, etc.</li>\n<li style=\"text-align:justify;\"><strong>Hecho para durar:</strong> De material resistente para que acompañe a tu mascota por largos años. </li>\n<li style=\"text-align:justify;\"><strong>Fácil de lavar:</strong> Es apto para meterlo al lavavajillas.</li>\n<li style=\"text-align:justify;\">Colores surtidos (le llegará al azar). </li>\n</ul>\n<p></p>",
